 ('20180101000000000_000_000_000_000_000_000_000_000_000_000_000_00','20180101000000000','USING','苏州市林泉街399号 东南大学研究院 文昌院502室','A0000001B0000000C0000000D0000000E0000000F0000000G0000000H0000000','lichkin.com','苏州鑫宏利业信息科技有限公司','  本公司成立于2014年05月08日。
