,('20180101000000000_000_000_000_000_000_000_000_000_000_000_000_01','20180101000000000','USING','北京市海淀区上地十街10号百度大厦','A0000002B0000000C0000000D0000000E0000000F0000000G0000000H0000000','baidu.com','百度','  百度（纳斯达克：BIDU），全球最大的中文搜索引擎、最大的中文网站。1999年底,身在美国硅谷的李彦宏看到了中国互联网及中文搜索引擎服务的巨大发展潜力，抱着技术改变世界的梦想，他毅然辞掉硅谷的高薪工作，携搜索引擎专利技术，于 2000年1月1日在中关村创建了百度公司。
