,('20180101000000000_000_000_000_000_000_000_000_000_000_000_000_03','20180101000000000','USING','深圳市南山区高新科技园北区','A0000004B0000000C0000000D0000000E0000000F0000000G0000000H0000000','tencent.com','腾讯','  深圳市腾讯计算机系统有限公司成立于1998年11月，由马化腾、张志东、许晨晔、陈一丹、曾李青五位创始人共同创立。
